        public DCAPv2Deployment() : base(BYTECODE) { }
        public DCAPv2Deployment(string byteCode) : base(byteCode) { }
    }

    public class DCAPv2DeploymentBase : ContractDeploymentMessage
    {
        public static string BYTECODE = "";
        public DCAPv2DeploymentBase() : base(BYTECODE) { }
        public DCAPv2DeploymentBase(string byteCode) : base(byteCode) { }
        [Parameter("string", "uriPrefix_", 1)]
        public virtual string UriPrefix { get; set; }
        [Parameter("bytes32", "checksum_", 2)]
        public virtual byte[] Checksum { get; set; }
        [Parameter("string", "predecessorId_", 3)]
        public virtual string PredecessorId { get; set; }
    }

